class recurseType(str, Enum):
    """recurseType -- 'recurse' defines how to recurse into the path entity, in other words what to follow during recursion. Options include symlinks, directories, or both. Note that a max-depth other than 0 has to be specified for recursion to take place and for this attribute to mean anything. Also note that this behavior does not apply to Windows systems since they do not support symbolic links. On Windows systems the 'recurse' behavior is always equivalent to directories.
    Note that this behavior only applies with the equality operation on the path entity.
    
    """
    DIRECTORIES='directories'
    SYMLINKS='symlinks'
    SYMLINKSANDDIRECTORIES='symlinks and directories'


class recurse_directionType(str, Enum):
    """recurse_directionType -- 'recurse_direction' defines the direction to recurse, either 'up' to parent directories, or 'down' into child directories. The default value is 'none' for no recursion.
    Note that this behavior only applies with the equality operation on the path entity.
    
    """
    NONE='none'
    UP='up'
    DOWN='down'


class recurse_file_systemType(str, Enum):
    """recurse_file_systemType -- 'recurse_file_system' defines the file system limitation of any searching and applies to all operations as specified on the path or filepath entity. The value of 'local' limits the search scope to local file systems (as opposed to file systems mounted from an external system). The value of 'defined' keeps any recursion within the file system that the file_object (path+filename or filepath) has specified.  For example, if the path specified was "/", you would search only the filesystem mounted there, not other filesystems mounted to descendant paths. The value of 'defined' only applies when an equality operation is used for searching because the path or filepath entity must explicitly define a file system. The default value is 'all' meaning to search all available file systems for data collection.
    Note that in most cases it is recommended that the value of 'local' be used to ensure that file system searching is limited to only the local file systems. Searching 'all' file systems may have performance implications.
    
    """
    ALL='all'
    LOCAL='local'
    DEFINED='defined'


